import React from 'react';
import BigCalendar from 'react-big-calendar';
import moment from 'moment';

import { Navbar } from '../ui/Navbar';

const localizer = BigCalendar.momentLocalizer(moment);

export const CalendarScreen = () => {
    return (
        <div>
            <Navbar />
            <BigCalendar
                localizer={localizer}
                events={myEventsList}
                startAccessor="start"
                endAccessor="end"
            />
        </div>
    )
}
